(2, 1, 1, 2, 1, 1, 2, '0', NULL, 'Hvs 100 gsm', '                                                                                                                        Kertas HVS PRINT 100 Gram  Ukuran A3+\r\nTebal, Kuat, dan Profesional untuk Cetakan Berkualitas Tinggi\r\n\r\nKertas HVS PRINT 100 GR ukuran A3+ dirancang khusus untuk kebutuhan cetak profesional yang memerlukan kualitas tinggi dan ketebalan ekstra. Cocok digunakan untuk dokumen penting, presentasi, desain grafis, hingga hasil cetak premium.\r\n\r\nSpesifikasi Produk:\r\n\r\nMerek: PRINT\r\n\r\nUkuran: A3+ (329 x 483 mm)\r\n\r\nGramasi: 100 gsm (gram per meter persegi)\r\n\r\nWarna: Putih cerah\r\n\r\nIsi: 500 lembar per rim\r\n\r\nKompatibel dengan: Printer Inkjet, Laser, dan Mesin Fotokopi\r\n\r\nKeunggulan Produk:\r\n\r\nKetebalan 100 gram memberikan kesan eksklusif dan tidak mudah tembus\r\n\r\nWarna putih cerah untuk hasil cetak yang lebih kontras dan tajam\r\n\r\nPermukaan halus, menjaga keawetan mesin printer dan menghindari kemacetan\r\n\r\nIdeal untuk keperluan cetak presentasi, proposal penting, karya desain, hingga portofolio\r\n\r\nPRINT HVS 100 GR A3+, solusi tepat untuk hasil cetak besar yang tebal, tajam, dan profesional!                        ', 'hvs1.jpg', 'HVS A3+ _ 2.jpg', 'HVS A3+ _ 3.jpg', '', 1, 0, 0, 0, 0, 0, '2025-06-17 09:07:11'),
(3, 1, 1, 3, 1, 1, 2, '0', NULL, 'Art Paper 120 gsm', 'Cetak Art Paper 120 gsm  Hasil Elegan & Profesional\r\nIngin hasil cetak yang lebih mewah dan berkelas? Cetak di kertas Art Paper 120 gsm adalah pilihan tepat untuk berbagai kebutuhan promosi, presentasi, dan materi visual Anda.\r\n\r\nSpesifikasi Produk:\r\n\r\nJenis Kertas: Art Paper 120 gsm  permukaan halus, licin, dan bertekstur premium\r\n\r\nUkuran: A5, A4, A3 (atau ukuran custom sesuai permintaan)\r\n\r\nCetak: Full Color / Hitam-Putih\r\n\r\nMetode: Digital printing kualitas tinggi\r\n\r\nCocok Untuk:\r\n\r\nBrosur\r\n\r\nFlyer\r\n\r\nUndangan\r\n\r\nPoster\r\n\r\nCompany profile\r\n\r\nMateri promosi produk dan event\r\n\r\nKeunggulan:\r\n\r\nWarna lebih hidup dan tajam\r\n\r\nPermukaan glossy memberikan kesan elegan dan profesional\r\n\r\nKertas cukup tebal namun tetap fleksibel\r\n\r\nMemberikan nilai tambah pada tampilan visual\r\n\r\nLayanan Tambahan (Opsional):\r\n\r\nLaminasi doff / glossy\r\n\r\nLipat, potong, atau jilid\r\n\r\nDesain cetak profesional (bisa request)\r\n\r\nCatatan:\r\n\r\nFile cetak sebaiknya dalam format PDF atau JPG resolusi tinggi\r\n\r\nEstimasi pengerjaan 12 hari kerja, tergantung jumlah dan layanan tambahan                                                                                     ', 'ap_1.jpg', 'ART PAPER_2.jpg', 'ART PAPER_3.jpg', '', 1, 0, 0, 0, 0, 0, '2025-06-17 09:12:49'),
(18, 1, 1, 4, 1, 1, 2, '0', NULL, 'Art Paper 150 gsm', '                                                                                                                                                                                                        ', 'ap_1.jpg', '', '', '', 1, 0, 0, 0, 0, 0, '2025-06-17 09:12:49'),
