(333, 7, 110, 488, 3, 1, 2, '0', NULL, 'Print Jersey (Dewasa) Reguler / Raglan Drifit Brazil', 'Print Jersey (Dewasa)  Reguler / Raglan Drifit Brazil\r\nTampilkan semangat sporty dan gaya penuh warna dengan Print Jersey Dewasa model Reguler atau Raglan berbahan Drifit Brazil. Jersey ini dirancang khusus untuk kamu yang aktif dan mengutamakan kenyamanan saat berolahraga maupun aktivitas harian.\r\n\r\nSpesifikasi Produk:\r\n\r\nModel: Reguler / Raglan (pilihan sesuai selera)\r\n\r\nBahan: Drifit Brazil  ringan, adem, dan menyerap keringat\r\n\r\nUkuran: Tersedia dalam berbagai ukuran dewasa (S  XXL)\r\n\r\nDesain: Full print custom dengan kualitas cetak tajam dan warna tahan lama\r\n\r\nCocok untuk: Futsal, sepak bola, lari, olahraga harian, maupun kegiatan komunitas\r\n\r\nKeunggulan:\r\n\r\nNyaman dipakai seharian, tidak panas dan cepat kering\r\n\r\nJahitan rapi dan kuat, cocok untuk pemakaian intens\r\n\r\nDesain bisa disesuaikan (custom nama, nomor, atau logo)\r\n\r\nCatatan:\r\n\r\nWaktu produksi 35 hari kerja setelah desain disetujui\r\n\r\nBisa pesan satuan maupun dalam jumlah banyak (harga khusus untuk pemesanan grosir)', 'official.png', NULL, NULL, NULL, 1, NULL, NULL, 0, 0, NULL, '2025-06-17 09:12:49'),
